import React from 'react';

export default function FieldTripQuestions() {
  return (
    <div>
      <h1 style={{ fontSize: '35px', fontWeight: 'bold', padding: '15px', marginTop: '30px', marginBottom: '20px', textAlign: 'center' }}>Field Trip Questions</h1>
      <div style={{ borderWidth: '4px', borderStyle: 'solid', borderColor: 'black', marginLeft: '30px', marginRight: '30px' }}>
        <div style={{ margin: '20px', color: 'orange', fontSize: '20px' }}>What is your school / organization</div>
        <input placeholder='input:' style={{ padding: '5px', margin: '20px', borderWidth: '1px', borderStyle: 'solid', borderColor: 'grey', display: 'block' }} />

        <div style={{ margin: '20px', color: 'orange', fontSize: '20px' }}>What movie would you like to see?</div>
        <input placeholder='input:' style={{ padding: '5px', margin: '20px', borderWidth: '1px', borderStyle: 'solid', borderColor: 'grey', display: 'block' }} />

        <div style={{ margin: '20px', color: 'orange', fontSize: '20px' }}>Any other details we should know about?</div>
        <input placeholder='input:' style={{ padding: '5px', margin: '20px', borderWidth: '1px', borderStyle: 'solid', borderColor: 'grey', display: 'block' }} />
      </div>
    </div>
  );
}
